type Coord = (Int,Int,Int)

data Nanobot = Nanobot {
    pos :: Coord,
    radius :: Int
} deriving (Show,Eq)

type Parser = Parsec () String

nanobotP :: Parser Nanobot
nanobotP = Nanobot <$> ((\[x,y,z] -> (x,y,z)) <$> (string "pos=<" *> signed space decimal `sepBy` char ',')) <*> (string ">, r=" *> decimal)

nanobot :: String -> Nanobot
nanobot = either undefined id . parse nanobotP ""

manhattan (x1,y1,z1) (x2,y2,z2) = abs (x1-x2) + abs (y1-y2) + abs (z1-z2)

solve1 = length . uncurry filter . ((>=) . radius . fst &&& uncurry fmap . first (manhattan . pos)) . (maximumBy (comparing radius) &&& fmap pos) . fmap nanobot

