roundBot divider (Nanobot (x,y,z) r) = Nanobot (x `div` divider, y `div` divider, z `div` divider) (ceiling (fromIntegral r / fromIntegral divider))

limitedRange x a rad = [max (10*a) (x-rad) .. min (10*a + 9) (x+rad)]

coords             (Nanobot (x,y,z) rad) = [(a,b,c) | a <- [x-rad..x+rad]       , b <- [y-rad..y+rad]       , c <- [z-rad..z+rad]       , manhattan (x,y,z) (a,b,c) <= rad]
coords2 (aa,bb,cc) (Nanobot (x,y,z) rad) = [(a,b,c) | a <- limitedRange x aa rad, b <- limitedRange y bb rad, c <- limitedRange z cc rad, manhattan (x,y,z) (a,b,c) <= rad]

minimumsBy f = nub . head . groupBy (\a b -> f a == f b) . sortOn f
maximumsBy f = nub . head . groupBy (\a b -> f a == f b) . sortOn (Down . f)

botsInRange = snd

distanceToOrigin = manhattan (0,0,0) . fst

process determineCoordinates divider = maximumsBy botsInRange . ((\bots -> fmap (id &&& (`inRangeOfBots` bots))) <$> id <*> determineCoordinates) . fmap (roundBot divider . nanobot)

start = process (nub . concatMap coords)

--nearestToOrigin = minimumsBy distanceToOrigin
nearestToOrigin = nub . concat . take 2 . groupBy (\a b -> distanceToOrigin a == distanceToOrigin b) . sortOn distanceToOrigin

cont point divider = nearestToOrigin . process (nub . concatMap (coords2 point)) divider

inRange :: (Int, Int, Int) -> Nanobot -> Bool
inRange c = (<=) <$> manhattan c . pos <*> radius

inRangeOfBots :: (Int, Int, Int) -> [Nanobot] -> Int
inRangeOfBots point = length . filter (inRange point)

corners ((x1,y1,z1),(x2,y2,z2)) = [(x,y,z) | x <- [x1, x2], y <- [y1, y2], z <- [z1, z2]]

inside :: ((Int, Int, Int),(Int,Int,Int)) -> Nanobot -> Bool
inside ((x1,y1,z1),(x2,y2,z2)) (Nanobot (x,y,z) _) = x >= x1 && x <= x2 && y >= y1 && y <= y2 && z >= z1 && z <= z2

botlines :: Nanobot -> [((Int, Int, Int),(Int,Int,Int))]
botlines (Nanobot (x,y,z) r) = (\xs -> [(xx,yy)| xx@(x1,x2,x3) <- xs, yy@(y1,y2,y3) <- xs, xx /= yy, x1/=y1 && x2/=y2 || x1/=y1 && x3/=y3 || x2/=y2 && x3/=y3]) [(a,b,c) | a <- [x-r,x,x+r], b <- [y-r,y,y+r], c <- [y-r,y,y+r], x == a && y == b || x == a && z == c || y == b && z == c, (a,b,c) /= (x,y,z)]

inRangeOf :: ((Int, Int, Int),(Int,Int,Int)) -> Nanobot -> Bool
inRangeOf box nb@(Nanobot (x,y,z) r) =
  or (($ nb) . inRange <$> corners box) ||
  or (intersects box <$> botlines nb)

inRangeOfBots2 :: ((Int, Int, Int),(Int,Int,Int)) -> [Nanobot] -> (((Int, Int, Int),(Int,Int,Int)),Int)
inRangeOfBots2 box = (box,) . length . filter (\nb -> inside box nb || inRangeOf box nb)

getCorners multiplier = nub . fmap ((\(x,y,z) -> (x `div` multiplier * multiplier,y `div` multiplier * multiplier,z `div` multiplier * multiplier)) . pos)

limits = (minimum &&& maximum) . concatMap (\(a,b,c) -> [a,b,c])

boxify step ((x1,y1,z1),(x2,y2,z2)) = nub $ [((x,y,z),(x+step,y+step,z+step)) | x <- [x1,x1+step .. x2-1], y <- [y1,y1+step .. y2-1], z <- [z1,z1+step .. z2-1]]

foo1 multiplier = maximumsBy snd . ((\fs bs -> fmap ($ bs) fs) <$> fmap inRangeOfBots2 . (\(mi,ma) -> boxify multiplier ((mi,mi,mi),(ma,ma,ma))) . limits . getCorners multiplier <*> id) . fmap nanobot

foo2 box multiplier = maximumsBy snd . (\bs -> (($ bs) . inRangeOfBots2) <$> boxify multiplier box) . fmap nanobot

intersects box line@(a,b) = intersects_ box line && intersects_ box (b,a)

intersects_ :: ((Int,Int,Int),(Int,Int,Int)) -> ((Int,Int,Int),(Int,Int,Int)) -> Bool
intersects_ ((x1,y1,z1),(x2,y2,z2)) ((a1,b1,c1),(d2,e2,f2)) = let
    a2 = d2-a1
    b2 = e2-b1
    c2 = f2-c1

    tmin = -9999999999999999999
    tmax = 9999999999999999999

    tx1 = fromIntegral (x1 - a1) / fromIntegral a2
    tx2 = fromIntegral (x2 - a1) / fromIntegral a2

    tmin1 = max tmin (min tx1 tx2)
    tmax1 = min tmax (max tx1 tx2)

    ty1 = fromIntegral (y1 - b1) / fromIntegral b2
    ty2 = fromIntegral (y2 - b1) / fromIntegral b2

    tmin2 = max tmin1 (min ty1 ty2)
    tmax2 = min tmax1 (max ty1 ty2)

    tz1 = fromIntegral (z1 - c1) / fromIntegral c2
    tz2 = fromIntegral (z2 - c1) / fromIntegral c2

    tmin3 = max tmin2 (min tz1 tz2)
    tmax3 = min tmax2 (max tz1 tz2)

  in
    tmax3 >= tmin3 && tmax3 >= 0

