tst strs = fmap (distanceToOrigin &&& id) $ sortOn (Down . botsInRange) $ do
  (x,_) <- start 10 strs
  cont x 1 strs

inp strs = fmap (distanceToOrigin &&& id) $ sortOn (Down . botsInRange) $ do
  (x1,_) <- start   100000000 strs
  (x2,_) <- cont x1 10000000 strs
  (x3,_) <- cont x2 1000000 strs
  (x4,_) <- cont x3 100000 strs
  (x5,_) <- cont x4 10000 strs
  (x6,_) <- cont x5 1000 strs
  (x7,_) <- cont x6 100 strs
  (x8,_) <- cont x7 10 strs
  cont x8 1 strs

tst2 strs = do
  (x1,_) <- foo1 10 strs
  ((b1,b2),bots) <- foo2 x1 1 strs
  pure $ sortOn Down $ fmap ((`inRangeOfBots` fmap nanobot strs) &&& manhattan (0,0,0) &&& id) [b1,b2]

inp2 strs = do
  (x1,_) <- foo1   100000000 strs
  (x2,_) <- foo2 x1 10000000 strs
  (x3,_) <- foo2 x2 1000000 strs
  (x4,_) <- foo2 x3 100000 strs
  (x5,_) <- foo2 x4 10000 strs
  (x6,_) <- foo2 x5 1000 strs
  (x7,_) <- foo2 x6 100 strs
  (x8,_) <- foo2 x7 10 strs
  ((b1,b2),bots) <- foo2 x8 1 strs
  pure $ head $ sortOn Down $ fmap ((`inRangeOfBots` fmap nanobot strs) &&& manhattan (0,0,0) &&& id) [b1,b2]

